import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import "./AdminDashboard.css";

function AdminDashboard() {
  const navigate = useNavigate();
  const [user, setUser] = useState({});
  const [coverImage, setCoverImage] = useState(""); // Store the uploaded image URL

  useEffect(() => {
    const loggedInUser = JSON.parse(localStorage.getItem("user"));
    setUser(loggedInUser || { username: "Admin", role: "Administrator" });
  }, []);

  const handleViewClubs = () => navigate("/clubs");
  const handleViewEvents = () => navigate("/events");
  const handleViewResources = () => navigate("/resources");
  const handleShareThoughts = () => navigate("/share-thought");
  const handleViewUsers = () => navigate("/all-users");
  const handleCreateClub = () => navigate("/create-club");
  const handleCreateEvent = () => navigate("/create-event");

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("user");
    navigate("/login");
  };

  const handleCoverImageChange = (e) => {
    const file = e.target.files[0];
    if (file) {
      const imageUrl = URL.createObjectURL(file);
      setCoverImage(imageUrl); // Store the image URL to use it as background
    }
  };

  return (
    <div className="dashboard">
      <div className="topbar">
        <div className="logo">Admin Dashboard</div>
        <div className="profile">
          <p>{user.username}</p>
          <p className="role">{user.role}</p>
        </div>
        <div className="actions">
          <button onClick={handleLogout} className="logout-btn">
            Logout
          </button>
        </div>
      </div>

      <div className="content">
        <h1>Welcome, {user.username}</h1>
        <p>Explore the admin functionalities below:</p>

        {/* Upload Cover Photo */}
        <div className="upload-section">
          <input
            type="file"
            accept="image/*"
            onChange={handleCoverImageChange}
            className="file-input"
          />
          <p>Upload a cover photo for the cards:</p>
        </div>

        {/* Cards Section */}
        <div className="dashboard-cards">
          <div className="card" onClick={handleViewClubs} style={{ backgroundImage: `url(${coverImage})` }}>
            <div className="card-title">Clubs</div>
          </div>

          <div className="card" onClick={handleViewEvents} style={{ backgroundImage: `url(${coverImage})` }}>
            <div className="card-title">Events</div>
          </div>

          <div className="card" onClick={handleViewResources} style={{ backgroundImage: `url(${coverImage})` }}>
            <div className="card-title">Resources</div>
          </div>

          <div className="card" onClick={handleShareThoughts} style={{ backgroundImage: `url(${coverImage})` }}>
            <div className="card-title">Share Thoughts</div>
          </div>

          <div className="card" onClick={handleViewUsers} style={{ backgroundImage: `url(${coverImage})` }}>
            <div className="card-title">View All Users</div>
          </div>

          <div className="card" onClick={handleCreateClub} style={{ backgroundImage: `url(${coverImage})` }}>
            <div className="card-title">Create Club</div>
          </div>

          <div className="card" onClick={handleCreateEvent} style={{ backgroundImage: `url(${coverImage})` }}>
            <div className="card-title">Create Event</div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default AdminDashboard;
